import logo from './logo.svg';
import axios from "axios";
import './App.css';

function App() {

  let btcCoinbase = {buyPrice : "", sellPrice : ""};
  let btcBinance = {buyPrice : "", sellPrice : ""};
  let ethCoinbase = {buyPrice : "", sellPrice : ""};
  let ethBinance = {buyPrice : "", sellPrice : ""};

  axios
      .get(
     "https://api.coinbase.com/v2/prices/ETH-USD/buy"
      )
      .then((res) => {
        ethCoinbase.buyPrice = res.data.data.amount;
      })
      .catch((error) => console.error(error));

      axios
      .get(
     "https://api.coinbase.com/v2/prices/ETH-USD/sell"
      )
      .then((res) => {
        ethCoinbase.sellPrice = res.data.data.amount;
      })
      .catch((error) => console.error(error));

  axios
      .get(
     "https://api.coinbase.com/v2/prices/BTC-USD/buy"
      )
      .then((res) => {
        btcCoinbase.buyPrice = res.data.data.amount;
      })
      .catch((error) => console.error(error));

      axios
      .get(
     "https://api.coinbase.com/v2/prices/BTC-USD/sell"
      )
      .then((res) => {
        btcCoinbase.sellPrice = res.data.data.amount;
      })
      .catch((error) => console.error(error));

  axios
      .get(
       "https://api.binance.com/api/v3/ticker/bookTicker?symbol=BTCUSDT"
      )
      .then((res) => {
        btcBinance.buyPrice = res.data.askPrice;
      })
      .catch((error) => console.error(error));

      axios
      .get(
       "https://api.binance.com/api/v3/ticker/bookTicker?symbol=BTCUSDT"
      )
      .then((res) => {
        btcBinance.sellPrice = res.data.bidPrice;
      })
      .catch((error) => console.error(error));

      axios
      .get(
       "https://api.binance.com/api/v3/ticker/bookTicker?symbol=ETHUSDT"
      )
      .then((res) => {
        ethBinance.buyPrice = res.data.askPrice;
      })
      .catch((error) => console.error(error));

      axios
      .get(
       "https://api.binance.com/api/v3/ticker/bookTicker?symbol=ETHUSDT"
      )
      .then((res) => {
        ethBinance.sellPrice = res.data.bidPrice;
      })
      .catch((error) => console.error(error));

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
